  `item_serialnum` varchar(12) DEFAULT NULL COMMENT '隐藏字段num',
  `item_tag` int(10) DEFAULT NULL COMMENT '产品标记，相同产品tag一致',
  `item_store` varchar(100) DEFAULT NULL COMMENT '店铺名称',
  PRIMARY KEY (`item_id`)
